import styles from "./../assets/components/Service.module.css";

function Service({
    nameService,
    logo,
}){
    function styleLogo(){
        switch(nameService){
            case("Caddy"): {
                return {width: 50, height: 50};
            }
                break;
            case("MongoDB"): {
                return {width: 50, height: 50};
            }
                break;
        }
    }
    return (
        <div className={styles.containerService}>
            <div className={styles.title}>
              <p>{nameService}</p>  
            </div>
            <img 
                src={logo} 
                alt={nameService}
                className={styleLogo()}  
            />
        </div>
    )
}

export default Service;
